import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.scss';
import App from './App';

$(document).ready(function() {
  $('select').material_select();
});
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
